@pmholling @UncleJo46902375 All exasperated by postal testing since the summer leading to 2 week delay.
Whilst ONS survey may offer some demographic snippets, the fact is it's now a lagging indicator.
Covid positivity, hospital data &amp; even Zoe (much maligned by me) offer more up to date signals of trend.

@OtherSideAus An unprecedented number of Australians had a taste of the welfare state during the pandemic.
In the next few years we'll have to pay for it as well as completely rebuilding the grid with a theoretical model.
2007 looked a lot like this then 2013 happened.
